// Navbar.js
import React, { useState } from 'react';
import styled from 'styled-components';
import { CiSearch, CiShoppingCart, CiUser } from "react-icons/ci";
import { FiMenu } from "react-icons/fi";
import { AiOutlineClose } from "react-icons/ai";

const Navbar = () => {
  const [isSidebarOpen, setSidebarOpen] = useState(false);

  const toggleSidebar = () => {
    setSidebarOpen(!isSidebarOpen);
  };

  return (
    <>
      <Nav>
        <NavLeft>
          <NavItem href="#"><img src="./logo.png" alt="Logo" /></NavItem>
          <NavItem href="#">Store</NavItem>
          <NavItem href="#">Phones</NavItem>
          <NavItem href="#">Tablets</NavItem>
          <NavItem href="#">TV & Smart Home</NavItem>
          <NavItem href="#">Smart Watch & Audio</NavItem>
        </NavLeft>
        <NavRight>
          <NavItem href="#">Discover</NavItem>
          <NavItem href="#">Support</NavItem>
          <NavIcon><CiSearch /></NavIcon>
          <NavIcon><CiShoppingCart /></NavIcon>
          <NavIcon><CiUser /></NavIcon>
          <MobileMenuIcon onClick={toggleSidebar}>
            <FiMenu />
          </MobileMenuIcon>
        </NavRight>
      </Nav>

      {/* Sidebar */}
      <SidebarBackdrop isOpen={isSidebarOpen} onClick={toggleSidebar} />
      <Sidebar isOpen={isSidebarOpen}>
        <SidebarHeader>
          <CloseIcon onClick={toggleSidebar}>
            <AiOutlineClose />
          </CloseIcon>
        </SidebarHeader>
        <SidebarContent>
          <SidebarItem href="#"><CenteredLogo src="./logo.png" alt="Logo" /></SidebarItem>
          <SidebarItem href="#">Store</SidebarItem>
          <SidebarItem href="#">Phones</SidebarItem>
          <SidebarItem href="#">Tablets</SidebarItem>
          <SidebarItem href="#">TV & Smart Home</SidebarItem>
          <SidebarItem href="#">Smart Watch & Audio</SidebarItem>
          <Spacer />
          <SidebarItem href="#">Discover</SidebarItem>
          <SidebarItem href="#">Support</SidebarItem>
        </SidebarContent>
      </Sidebar>
    </>
  );
};

export default Navbar;

// Styled Components

const Nav = styled.nav`
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 15px 20px;
  background-color: #f1f1f1;
  box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1);
  position: sticky;
  top: 0;
  z-index: 100;
  font-family: 'Poppins', sans-serif; /* Font for the whole navbar */
`;

const NavLeft = styled.div`
  display: flex;
  align-items: center;
  gap: 20px;

  @media (max-width: 1024px) {
    gap: 10px;
    & > a:not(:first-child) {
      display: none; /* Hide items except logo */
    }
  }
`;

const NavRight = styled.div`
  display: flex;
  align-items: center;
  gap: 20px;

  @media (max-width: 1024px) {
    & > a {
      display: none; /* Hide NavItems on smaller screens */
    }
  }
`;

const NavItem = styled.a`
  text-decoration: none;
  color: black;
  font-size: 16px;
  font-weight: 500;
  cursor: pointer;
  position: relative;
  transition: color 0.3s ease-in-out;

  &:hover {
    color: black;
    text-decoration: none;
  }

  &:hover::after {
    content: "";
    position: absolute;
    bottom: -5px;
    left: 0;
    width: 100%;
    height: 1px;
    background-color: black;
  }

  &::after {
    content: "";
    position: absolute;
    bottom: -5px;
    left: 0;
    width: 0%;
    height: 1px;
    background-color: black;
    transition: width 0.3s ease-in-out;
  }

  &:hover::after {
    width: 100%;
  }
`;

const NavIcon = styled.div`
  font-size: 22px;
  cursor: pointer;
  color: black;
  transition: color 0.3s ease-in-out;

  &:hover {
    color: #007bff;
  }

  @media (max-width: 1024px) {
    font-size: 20px;
  }
`;

const MobileMenuIcon = styled.div`
  display: none;

  @media (max-width: 1024px) {
    display: block;
    font-size: 24px;
    cursor: pointer;
  }
`;

/* Sidebar Styles */
const SidebarBackdrop = styled.div`
  position: fixed;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  background-color: rgba(0, 0, 0, 0.5);
  z-index: 150;
  display: ${({ isOpen }) => (isOpen ? 'block' : 'none')};
`;

const Sidebar = styled.div`
  position: fixed;
  top: 0;
  left: 0;
  width: 250px;
  height: 100%;
  background-color: #f1f1f1;
  box-shadow: 2px 0 5px rgba(0, 0, 0, 0.5);
  transition: transform 0.3s ease-in-out;
  transform: ${({ isOpen }) => (isOpen ? 'translateX(0)' : 'translateX(-100%)')};
  z-index: 200;
  font-family: 'Poppins', sans-serif;
`;

const SidebarHeader = styled.div`
  display: flex;
  justify-content: flex-end;
  padding: 10px 20px;
  background-color: #f1f1f1;
`;

const CloseIcon = styled.div`
  font-size: 24px;
  cursor: pointer;
`;

const SidebarContent = styled.div`
  display: flex;
  flex-direction: column;
  padding: 20px;
`;

const SidebarItem = styled.a`
  text-decoration: none;
  color: black;
  font-size: 18px;
  padding: 10px 0;
  cursor: pointer;
  transition: color 0.3s ease-in-out;
  border-bottom: 1px solid #e0e0e0;

  &:hover {
    color: black; /* Removed blue color */
  }
`;

const CenteredLogo = styled.img`
  width: 100px;
  height: auto;
  display: block;
  margin: 0 auto 20px auto; /* Centered the logo */
`;

const Spacer = styled.div`
  margin-top: 40px; /* Adds spacing between items */
`;
